const fontFamily = {
  primaryFont: "Helvetica",
};

const fontStyles = {};

const color = {
  greyLight: "#ebebeb",
  black: "#222222",
  white: "#FFFFFF",
};

const medias = {
  medium: "(max-width: 1024px)",
  mobile: "(max-width: 768px)",
};

const theme = {
  fontFamily,
  fontStyles,
  color,
  medias,
};

export default theme;
